(802, 'NKPO051124AGRIC020002', 'AGRIC02', '1. schedule pengiriman akan di bagi selama bulan november dan desember (menyusul)\r\n2. on time payment 2% di potongkan langsung di invoice krn karisma selalu membayar ontime dan tidak pernah terlambat (boleh di cek di departemen keuangan agricon)\r\n3. discount invoice sebanyak 2,5%. sehingga total diskon di invoice sebanyak 4,5% \r\n4. karisma di anggap telah mencapai target tahunan all produk di 2024 dan berhak mendapatkan 1% dari pencapaian all value di 2024 (revisi target di sesuaikan dengan pencapaian karisma akan menyusul). \r\n5. karisma di anggap telah mencapai kuartal4 sehingga berhak mendapatkan 0,5% dari value pencapaian kuartal4\r\n6. program SPONTAN kuartal4 DR 2% dan RR 3% (total 5%) berupa produk akan dikirimkan bersamaan dengan pengiriman barang\r\n7. program NON SPONTAN kuartal4 DR 3% dan RR 3% (total 6%) berupa produk akan dikirimkan bersamaan dengan pengiriman barang\r\n8. apabila tidak setuju dengan notes kami di atas, mohon jangan di rilis dan jangan di invoice kan dulu, namun diskusi kembali dengan kami\r\n9. apabila PO ini di rilis dan di invoice kan, maka di anggap telah setuju dengan semua notes yang sudah kami sampaikan di atas.\r\nTERIMA KASIH', '', '2024-11-05 04:17:09'),
